import React from 'react';

const SponsorCard = props => {
    console.log(props);
    return <a href={props.link}>
        <div>
            <div class="sponsorLogoContainer">
                <img class="sponsorLogo" src={props.logo}/>
            </div>
            <div class="sponsorName">
                {props.name}
            </div>
        </div>
    </a>
}

export default SponsorCard;
